- input: "TEXT\x1CC00161067\x1C.TEXT\x1C\x1CF3XA\x1CThis admendment is in response
    to the FEC letter dated July 2, 2009 concerning this report.  Item 1- The disbursements
    referred to for donations to civic organizations and the event catagory has been
    changed to reflect 'Donations'.  Item 2- Payments for 'health insurance', 'salary'
    and 'withholding taxes' are for employees  who spend less than 25% of their time
    on Federal Election Activity.   Amendment 2 is in response to the FEC letter dated
    August 7,2009 concerning admendment 1 and two disbursements that were categorized
    as 'fundraising expenses'.  These two items have been re-categorized as 'Administrative'
    expenses as what they properly are.\n"
